Here are the different steps you need to follow, in order to register a new internal variable / function in a module. 1st step: Create a method inside the module called generate_<internal_variable_or_function_name>() that will generate your internal variable / function, that means it will return either a lambda function (representing the internal function) or directly the internal variable you want to expose. All generation methods are ordered by alphabetical order based on the internal variable / function name. Try to give a good, self-explanatory name for your variable / function. 2nd step: Register your internal variable / function in the static_templates or dynamic_templates map depending on whether your internal variable / function on the file when executed. The registration happens either in createStaticTemplates or updateTemplates. To register your variable / function, use your this.generate_<internal_variable_or_function_name>() method you defined earlier: this.static_templates.set(<internal_variable_or_function_name>, this.generate_<internal_variable_or_function_name>());
OR
this.dynamic_templates.set(<internal_variable_or_function_name>, this.generate_<internal_variable_or_function_name>()); Internal variable / function registrations are also ordered by alphabetical order based on the variable / function name. 3rd step: Add your internal variable / function documentation to Templater's documentation . And you are done ! Thanks for contributing to Templater ! Now, just submit a pull request on Github, I'll try to be as reactive as possible.

