Let's say you specified the Scripts folder as your script folder in Templater's settings. Templater will load all JavaScript (.js files) scripts in the Scripts folder. You can then create your script named Scripts/my_script.js (the .js extension is required) for example. You will likely have to create the file outside of Obsidian, as Obsidian only creates markdown files. You will then be able to call your scripts as user functions. The function name corresponds to the script file name . Scripts should follow the CommonJS module specification , and export a single function or object where all the keys are functions. module.exports = function (msg) { return `Message from my script: ${msg}`;
}; In this example, a complete command invocation would look like this: <% tp.user.my_script("Hello World!") %> Which would output Message from my script: Hello World!. You can also export an object of functions. Note that every property of the object must be a function. function formatAsCallout(text, type = "note") { const blockQuoteLines = text.split("\n").map((line) => `> ${line}`); return `> [!${type}]\n${blockQuoteLines.join("\n")}`;
} module.exports = { note: (text) => formatAsCallout(text, "note"), tip: (text) => formatAsCallout(text, "tip"), warning: (text) => formatAsCallout(text, "warning"),
}; In this example, a complete command invocation would look like this: <% tp.user.my_script.note("Line 1\nLine2") %> Which would output: > [!note]
> Line 1
> Line2

